  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains vector polygons
  representing the boundaries of all hardcopy cartographic products produced as part
  of the Environmental Sensitivity Index (ESI) for Virginia. This data set comprises
  a portion of the ESI data for Virginia. ESI data characterize the marine and coastal
  environments and wildlife by their sensitivity to spilled oil. The ESI data include
  information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
